    & external_perm_ppttj_dec_nenmxexmbbxgggg_1, &
    & external_perm_inv_ppttj_dec_nenmxexmbbxgggg_1, &
    & extcomb_perm_ppttj_dec_nenmxexmbbxgggg_1, &
    & average_factor_ppttj_dec_nenmxexmbbxgggg_1, &
    & photonid_ppttj_dec_nenmxexmbbxgggg_1
  use ol_external_ppttj_dec_nenmxexmbbxgggg_1, only: &
    & H, hel_not_initialised, hel_init, POLSEL
  use ol_colourmatrix_ppttj_dec_nenmxexmbbxgggg_1_/**/REALKIND, only: &
    & colmat_not_initialised, colourmatrix_init
