  M1(23) = (A(j,25)%j-A(j,26)%j-A(j,49)%j+A(j,51)%j-A(j,56)%j-A(j,66)%j+A(j,74)%j+A(j,81)%j+A(j,129)%j+A(j,146)%j)*f(1) &
        +CI*(A(j,1)%j-A(j,2)%j-A(j,4)%j+A(j,5)%j-A(j,31)%j+A(j,32)%j+A(j,34)%j-A(j,36)%j+A(j,52)%j-A(j,54)%j+A(j,55)%j+A(j,67)%j &
        +A(j,68)%j-A(j,73)%j-A(j,83)%j-A(j,84)%j-A(j,128)%j-A(j,134)%j)*f(2)
  M1(24) = (A(j,10)%j-A(j,11)%j+A(j,49)%j-A(j,50)%j+A(j,56)%j+A(j,66)%j+A(j,90)%j+A(j,96)%j+A(j,126)%j+A(j,140)%j)*f(1)+CI*( &
        -A(j,1)%j+A(j,2)%j-A(j,16)%j+A(j,17)%j-A(j,19)%j+A(j,20)%j-A(j,34)%j+A(j,35)%j-A(j,52)%j+A(j,53)%j-A(j,55)%j-A(j,67)%j &
        -A(j,68)%j-A(j,88)%j-A(j,98)%j-A(j,99)%j-A(j,125)%j-A(j,135)%j)*f(2)

end subroutine colourvector


! **********************************************************************
subroutine colint(M, M2colint, extcombs)
! M(i)   = <M|Ci> colour component of matrix element
! COLINT = <M|M>
!        = Sum_{i,j} <M|Ci> * <Ci|Cj> * <Cj|M>
!        = colour-summed squared matrix element
! K1(i,j) = <Ci|Cj>
! M2colint is an array which contains the colour interference for each colour matrix
! The elements of the array extcombs specifies for which external particle
! combinations the colour correlations will be calculated. For particles i,j: i*(i-1)/2+j
! i=j=0 -> 0 means no colour insertion.
! **********************************************************************
  use ol_colourmatrix_ppttj_dec_nenmxexmbbxgggg_1_/**/REALKIND, only: K1
  implicit none

  complex(REALKIND), intent(in)  :: M(24)
  real(REALKIND),    intent(out) :: M2colint(0:57-1)
  integer,           intent(in)  :: extcombs(:)
  integer :: extcomb, colmatpos, i, j, eco

  M2colint = 0

  do eco = 1, size(extcombs)
    extcomb = extcombs(eco)
    colmatpos = 24*extcomb
    do i = 1, 24
      do j = 1, 24
        M2colint(extcomb) = M2colint(extcomb) + real(conjg(M(i))*K1(i+colmatpos,j)*M(j))
      end do
    end do
  end do

end subroutine colint


! **********************************************************************
subroutine colint2(M1, M2, M2colint, extcombs)
! M1(i)   = <M1|Ci> colour component of matrix element
! M2(i)   = <M2|Ci> colour component of matrix element
! COLINT = <M|M>
!        = Sum_{i,j} <M1|Ci> * <Ci|Cj> * <Cj|M2>
!        = colour-summed squared matrix element
! K1(i,j) = <Ci|Cj>
! M2colint is an array which contains the colour interference for each colour matrix
! The elements of the array extcombs specifies for which external particle
! combinations the colour correlations will be calculated. For particles i,j: i*(i-1)/2+j
! i=j=0 -> 0 means no colour insertion.
! **********************************************************************
  use ol_colourmatrix_ppttj_dec_nenmxexmbbxgggg_1_/**/REALKIND, only: K1
  implicit none

  complex(REALKIND), intent(in)  :: M1(24), M2(24)
  real(REALKIND),    intent(out) :: M2colint(0:57-1)
  integer,           intent(in)  :: extcombs(:)
  integer :: extcomb, colmatpos, i, j, eco

  M2colint = 0

  do eco = 1, size(extcombs)
    extcomb = extcombs(eco)
    colmatpos = 24*extcomb
    do i = 1, 24
      do j = 1, 24
        M2colint(extcomb) = M2colint(extcomb) + real(conjg(M1(i))*K1(i+colmatpos,j)*M2(j))
      end do
    end do
  end do

end subroutine colint2


! **********************************************************************
subroutine colintmunu(M1, M2, M2colint)
! M1(i)    = <M1|Ci> colour component of matrix element
! M2(i)    = <M2|Ci> colour component of matrix element
! M2colint = <M1|M2>
!          = Sum_{i,j} <M1|Ci> * <Ci|Cj> * <Cj|M2>
!          = colour-summed squared matrix element
! K1(i,j) = <Ci|Cj>
! **********************************************************************
  use ol_colourmatrix_ppttj_dec_nenmxexmbbxgggg_1_/**/REALKIND, only: K1
  implicit none

  complex(REALKIND), intent(in)  :: M1(24)
  complex(REALKIND), intent(in)  :: M2(24)
  complex(REALKIND),    intent(out) :: M2colint
  integer :: i, j

  M2colint = 0

  do i = 1, 24
    do j = 1, 24
      M2colint = M2colint + M1(i)*K1(i,j)*conjg(M2(j))
    end do
  end do

end subroutine colintmunu

